import React, { useState } from 'react';
import '../styles/SignupForm.css';


function SignupForm() {
  let container = document.getElementById('container')

  toggle = () => {
    container.classList.toggle('sign-in')
    container.classList.toggle('sign-up')
  }
  
  setTimeout(() => {
    container.classList.add('sign-in')
  }, 200)
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmpassword, setConfirmPassword] = useState('');
  const [name, setName] = useState('');

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };
  const handleConfirmPassword = (e) => {
    setConfirmPassword(e.target.value);
  };

  const handleNameChange = (e) => {
    setName(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // 회원가입 요청 처리
    // 이 부분에서 실제로 서버와 통신하여 회원가입 처리를 수행합니다.
    // 예시로는 간단히 콘솔에 회원가입 정보를 출력하는 예시를 보여줍니다.

    console.log('Email:', email);
    console.log('Password:', password);
    console.log('Name:', name);

    // 회원가입 후에 필요한 처리를 수행합니다.
    // 예를 들어, 회원가입 성공 시에 다른 페이지로 이동하거나 상태를 업데이트하는 등의 작업을 수행할 수 있습니다.
  };

  return (
    <div className='wrapper'>
      <div class="title">
        <h1>회원가입</h1>
      </div>

      <div className='container'>
        <div className="row">
          <div className="col align-items-center flex-col sign-up">
            <div className="form-wrapper align-items-center">
              <div className="form sign-up">
                <div className="input-group">
                  <i className='bx bxs-user'></i>
                  <input type="text" placeholder="Username" value={name} onChange={handleNameChange}/>
                </div>
                <div class="input-group">
                  <i class='bx bx-mail-send'></i>
                  <input type="email" placeholder="Email"/>
                </div>
                <div class="input-group">
                  <i class='bx bxs-lock-alt'></i>
                  <input type="password" placeholder="Password"/>
                </div>
                <div class="input-group">
                  <i class='bx bxs-lock-alt'></i>
                  <input type="password" placeholder="Confirm password"/>
                </div>
                <button>
                  Sign up
                </button>
                <p>
                  <span>
                    Already have an account?
                  </span>
                  <b onclick="toggle()" class="pointer">
                    Sign in here
                  </b>
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div>
      <form onSubmit={handleSubmit}>
      <div className='email'>
        <div className='mt-4'>
          <label className=''>Email:</label>
          <input type="email" className='email input' placeholder='특수문자 사용 불가, 최소 2자 이상'value={email} onChange={handleEmailChange} />
        </div>
        <div className='password'>
          <label>비밀번호 :</label>
          <input type="password" className='w-full border-2' placeholder='숫자, 영어, 특수문자 혼합 8자 이상' value={password} onChange={handlePasswordChange} />
        </div>
        <div>
          <label>비밀번호 확인 :</label>
          <input type="password" className='w-full border-2'  value={confirmpassword} onChange={handleConfirmPassword} />
        </div>
        <div>
          <label>수영장 이름:</label>
          <input type="text" className='w-full border-2' value={name} onChange={handleNameChange} />
        </div>
        <div>
          <label>수영장 wjsghkqjsgh:</label>
          <input type="text" className='w-full border-2' value={name} onChange={handleNameChange} />
        </div>
        <div>
          <label>수영장 주소:</label>
          <input type="text" className='w-full border-2' value={name} onChange={handleNameChange} />
        </div>
        <button type="submit">회원 가입</button>
        </div>
      </form>
      </div>
    </div>
  );
}

export default SignupForm;
